import React from "react";
import { ReactComponent as ShippmentLogo } from "../../assets/paper-plane.svg";
import "./OrderSummery.scss";

const OrderSummery = ({ location }) => {
  const { card } = location.state.token;
  console.log(card);
  return (
    <div className="order-summery">
      <ShippmentLogo />
      <h1 className="title">Your order has been placed!</h1>
      <h3 className="sub title">
        Be pacient {card.name.toUpperCase()}, it'll worth it!
      </h3>
      <h4>We are now preparing your shipment to: </h4>

      <div className="shippment-details">
        <span className="country">{card.address_country}</span>
        <span className="zip-code">{card.address_zip}</span>
        <span className="street">{card.address_line1}</span>
        <span className="city">{card.address_city}</span>
      </div>
    </div>
  );
};

export default OrderSummery;
